import React from 'react';
import './App.css';
import Header from './Header/Header';
import {Switch,Route} from 'react-router-dom'
import Global from './Body/Global/Global'
import Country from './Body/Countries/Country'

function App() {
  return (
    <div className="App">
    <Header></Header>
    <Switch>

      <Route path="/global" exact component={Global}/>
      <Route path="/country" exact componenet={Country}/>
      </Switch>
    </div>
  );
}

export default App;
